The Best Democracy Money Can Buy
By Greg Palast


Format: MP3
Bitrate: 32 Kbps


This 2002 book written by investigative journalist Greg Palast deals with corporate corruption, global capitalism, environmental destruction, third world exploitation, freedom of speech and political corruption, and the United States presidential election of 2000.


Greg Palast is a New York Times-bestselling author and a journalist for the British Broadcasting Corporation as well as the British newspaper The Observer.


